import React from 'react';
import ReactDOM from 'react-dom';
import {Route,BrowserRouter,Switch,Redirect} from 'react-router-dom';

import App from './components/App';


ReactDOM.render(
  <React.StrictMode>
      <BrowserRouter>
      <div className="app"></div>
    <App />
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
